function Jiaxin() {
    return (
      <div className="App">
        <h1>Jiaxin's page</h1>
        <form>
            <input>Enter your name: </input>
        </form>
      </div>
    );
  }

  export default Jiaxin;


import React from 'react';
import ReactDOM from 'react-dom/client';

function MyForm() {
  return (
    <form>
      <label>Enter your name:
        <input type="text" />
      </label>
    </form>
  )
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<MyForm />);
